    def set_scanned(self, libraries):
        books = set([])

        for library in libraries:
            for book in library.books:
                if book not in books:
                    library.scanned_books.append(book)
            books.update(library.books)

    def calc_score(self, libraries):
        books = set([])

        for library in libraries:
            books.update(library.books)

        return sum(map(lambda b: b.score, books))

    def calc_probability(self, score, new_score, temperature):
        if (new_score > score):
            return 1.0

        return math.exp(-abs(new_score - score) / temperature);

    def generate_new_libraries(self, libraries, count=1):
        new_libraries = libraries[:]
        new_libraries_set = set(libraries)

        probabilities = []
        for library in new_libraries:
            probabilities.append(library.calc_book_probability())

        total = sum(probabilities)
        j = 0
        while True:
            rand = random.random() * total
            i = 0
            while rand > 0:
                i += 1
                if i >= len(probabilities):
                    i = random.randint(0, len(probabilities))
                rand -= probabilities[i]

                continue

            for book in new_libraries[i].books:
                book.counter -= 1

            for book in new_libraries[i].books:
                for library in book.libraries:
                    if library in new_libraries_set:
                        try:
                            index = new_libraries.index(library)
                            probabilities[index] = library.calc_book_probability()
                        except:
                            pass

            del probabilities[i]
            del new_libraries[i]
            total = sum(probabilities)

            j += 1

            if j == count:
                break

        new_libraries = set(new_libraries)

        candidates = []
        for library in self.libraries:
            if library not in new_libraries:
                candidates.append(library)

        random.shuffle(candidates)
        new = candidates[:count]

        for i in range(count):
            new_libraries.add(new[i])

        new_libraries = list(new_libraries)
        random.shuffle(new_libraries)

        for book in self.books:
            book.counter = 0

        books = set([])
        for library in new_libraries:
            for book in library.books:
                book.counter += 1
            books.update(library.books)

        return new_libraries
